import React from 'react'

const Footer = () => {
  return (
    <div className='bg-gray-700 p-4'>
      <div className='container mx-auto text-center font-bold text-white'>
        Projeto desenvolvido por <a>Murillo Souza</a> / <a>Linkedin</a> / <a>GitHub</a>
        <img className='mx-auto' src='/logo_semana_fsm.png' alt='FSM' />
        <img className='mx-auto' src='/logo_devpleno.png' alt='DevPlenp' />
      </div>
    </div >
  )
}
export default Footer
